function sk(id, relationId) {
    var _obj = $('#' + id);
    _obj.attr({
        'fill': sk_config[id].upColor,
        'fill-opacity': sk_config[id].upOpacity,
        'stroke': sk_config[id].outlineUpColor,
        'stroke-opacity': sk_config[id].outlineUpOpacity
    });
    _obj.attr({
        'cursor': 'default'
    });
    if (sk_config[id].enable == !0) {
        if (isTouchEnabled()) {
            _obj.on('touchstart', function (e) {
                var touch = e.originalEvent.touches[0];
                var x = touch.pageX + 10,
                    y = touch.pageY + 15;
                var tipw = $('#organs-tip').outerWidth(),
                    tiph = $('#organs-tip').outerHeight(),
                    x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
                y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
                $('#' + id).css({
                    'fill': sk_config[id].overColor,
                    'fill-opacity': sk_config[id].downOpacity,
                    'stroke': sk_config[id].outlineDownColor,
                    'stroke-opacity': sk_config[id].outlineDownOpacity
                });
                $('#organs-tip').show().html(sk_config[id].hover);
                $('#organs-tip').css({
                    left: x,
                    top: y
                })
            })
            _obj.on('touchend', function () {
                $('#' + id).css({
                    'fill': sk_config[id].upColor,
                    'fill-opacity': sk_config[id].upOpacity,
                    'stroke': sk_config[id].outlineUpColor,
                    'stroke-opacity': sk_config[id].outlineUpOpacity
                });
                if (sk_config[id].target == 'new_window') {
                    window.open(sk_config[id].url)
                } else if (sk_config[id].target == 'same_window') {
                    window.parent.location.href = sk_config[id].url
                } else if (sk_config[id].target == 'modal') {
                    jQuery(sk_config[id].url).modal("show")
                }
            })
        }
        _obj.attr({
            'cursor': 'pointer'
        });
        _obj.hover(function () {
            $('#organs-tip').show().html(sk_config[id].hover);
            _obj.css({
                'fill': sk_config[id].overColor,
                'fill-opacity': sk_config[id].overOpacity,
                'stroke': sk_config[id].outlineOverColor,
                'stroke-opacity': sk_config[id].outlineOverOpacity
            })
        }, function () {
            $('#organs-tip').hide();
            $('#' + id).css({
                'fill': sk_config[id].upColor,
                'fill-opacity': sk_config[id].upOpacity,
                'stroke': sk_config[id].outlineUpColor,
                'stroke-opacity': sk_config[id].outlineUpOpacity
            })
        })
        _obj.mousedown(function () {
            $('#' + id).css({
                'fill': sk_config[id].downColor,
                'fill-opacity': sk_config[id].downOpacity,
                'stroke': sk_config[id].outlineDownColor,
                'stroke-opacity': sk_config[id].outlineDownOpacity
            })
        })
        _obj.mouseup(function () {
            $('#' + id).css({
                'fill': sk_config[id].overColor,
                'fill-opacity': sk_config[id].overOpacity,
                'stroke': sk_config[id].outlineOverColor,
                'stroke-opacity': sk_config[id].outlineOverOpacity
            });
            if (sk_config[id].target == 'new_window') {
                window.open(sk_config[id].url)
            } else if (sk_config[id].target == 'same_window') {
                window.parent.location.href = sk_config[id].url
            } else if (sk_config[id].target == 'modal') {
                jQuery(sk_config[id].url).modal("show")
            }
        })
        _obj.mousemove(function (e) {
            var x = e.pageX + 10,
                y = e.pageY + 15;
            var tipw = $('#organs-tip').outerWidth(),
                tiph = $('#organs-tip').outerHeight(),
                x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
            y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
            $('#organs-tip').css({
                left: x,
                top: y
            })
        })
    }
}
$(function () {
    var points_len = sk_spots.spots.length;
    if (points_len > 0) {
        var xmlns = "http://www.w3.org/2000/svg";
        var tsvg_obj = document.getElementById("sk_spots");
        var svg_circle;
        for (var i = 0; i < points_len; i++) {
            svg_circle = document.createElementNS(xmlns, "circle");
            svg_circle.setAttributeNS(null, "cx", sk_spots.spots[i].pos_X);
            svg_circle.setAttributeNS(null, "cy", sk_spots.spots[i].pos_Y);
            svg_circle.setAttributeNS(null, "r", sk_spots.spots[i].diameter / 2);
            svg_circle.setAttributeNS(null, "fill", sk_spots.spots[i].upColor);
            svg_circle.setAttributeNS(null, "fill-opacity", sk_spots.spots[i].upOpacity);
            svg_circle.setAttributeNS(null, "stroke", sk_spots.spots[i].outlineUpColor);
            svg_circle.setAttributeNS(null, "stroke-opacity", sk_spots.spots[i].outlineUpOpacity);
            svg_circle.setAttributeNS(null, "id", 'sk_spots_' + i);
            tsvg_obj.appendChild(svg_circle);
            dynamicAnatomySpots(i)
        }
    }
});

